INSERT INTO ap_static_label VALUES (null, 'static.inventoryDate.inventoryReport', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1477, 1, "Inventory Last Reported On");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.addressed', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1478, 1, "Addressed");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.addressedDesc', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1479, 1, "Issue has been manually marked by either reviewer or user as ‘addressed’. The user applies this status when they cannot resolve the issue through data entry. This status must be accompanied by a note. The reviewer uses this status if this issue cannot be resolved this review period, but will be resolved in the future, most likely in a few periods, rather than before the next review.");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.addressedExample', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1480, 1, "A phasing out planning unit only has 8 months of forecasted consumption in the future instead of 18. This is acceptable as it is a phasing out planning unit, but the user will still need to de-activate the planning unit once it is fully phased out, which is why the issue is marked as ‘addressed’ instead of ‘resolved’.");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.approved', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1481, 1, "Approved");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.approvedDesc', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1482, 1, "The submitted supply plan has been approved. The issues addressed and/or notes added by the Program User are deemed acceptable by the Supply Plan Reviewer. Approved supply plans may be shared with external stakeholders, depending on the realm.");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.inCompliance', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1483, 1, "In-Compliance");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.inComplianceDesc', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1484, 1, "Issue has been closed through data entry by the user. Status will be automatically changed, and notes are not required.");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.inComplianceExample', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1485, 1, "A planning unit is missing actual consumption in the last 3 months. A user enters actual consumption data for the last 3 months. QAT automatically marks this as ‘in-compliance’.");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.issueReviewStatus', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1486, 1, "Issue Review Status");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.issueStatus', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1487, 1, "Issue Status");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.open', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1488, 1, "Open");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.openDesc', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1489, 1, "This issue has been automatically flagged by QAT, or the issue has been manually marked by the reviewer as ‘open’. The reviewer uses this status when rejecting a supply plan to indicate that the notes are not accepted. The reviewer uses this status when accepting a supply plan to indicate this issue cannot be resolved this review period but should be corrected via data entry or addressed next review period.");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.openExample', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1490, 1, "A shipment with a receive date in the next 6 months is missing a funding source. The user notes that they will have a funder assigned to this shipment next month. The reviewer wants to ensure the funder is added for the next submission and thus marks it as ‘open,’ instead of ‘addressed.’");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.rejected', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1491, 1, "Rejected");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.rejectedDesc', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1492, 1, "The submitted supply plan has not been approved. The reviewer has reviewed all notes and rejected any issues that have the status of “open.” Users should make additional edits on any open issues for re-submission.");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.resolved', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1493, 1, "Resolved");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.resolvedDesc', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1494, 1, "Issue has been manually marked by reviewer as ‘resolved’. The reviewer uses this status if this issue will unlikely be corrected via data entry and also does not require further notes in the future. Only a reviewer can mark an issue as ‘resolved’.");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.resolvedExample', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1495, 1, "A planning unit gets flagged for not following dynamic forecasting. The user enters a note that this planning unit does not follow dynamic forecasting as it is not a seasonal product. The reviewer marks this as resolved because the explanation will most likely not change in the future.");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.reviewed', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1496, 1, "Reviewed");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.reviewedDesc', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1497, 1, "The issue has been reviewed by the supply plan reviewer. This field is only editable by the supply plan reviewer.");					
INSERT INTO ap_static_label VALUES (null, 'static.problemReport.supplyPlanStatus', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1498, 1, "Supply plan status");					
INSERT INTO ap_static_label VALUES (null, 'static.report.approvedRevieweddate', 1);	INSERT INTO ap_static_label_languages VALUES (null, 1499, 1, "Date Approved/Rejected");					
